<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, user-scalable=no">
    <title>Oops! You Forgot Something</title>
    <style>
        body{
            padding-bottom:0 !important;
            font-family:'-webkit-pictograph';
            margin:0;
        }
        *{
            box-sizing: border-box;
        }
        ul,li,ol{padding: 0;margin: 0;list-style: none;}
        img{border: none;}
        a:focus{ outline: none; }
        .email-box{
            width:712px;
            background: #edeaeb;
            margin:0 auto;
        }
        .email-box .email-banner{
            width:100%;
        }
        .email-box .email-banner img{
            width:100%;
            height:346px;
        }
        .email-box .email-content{
            padding:45px 50px 50px;
            color:#78502e;
        }
        .email-box .email-content h2{
            margin:0 0 10px;
            display: inline-block;
            font-size:30px;
        }
        .email-box .email-content p{
            font-size:24px;
        }
        .email-box .email-content a{
            color:#fff;
            font-size:28px;
            display:block;
            width:310px;
            height:60px;
            text-align:center;
            line-height:60px;
            background: #a08877;
            margin:60px auto 0;
            text-decoration: none;
        }

        @media (max-width: 767px) {
            body{
                background: #edeaeb;
            }
            .email-box {
                width:100%;
            }
            .email-box .email-banner img{
                height:auto;
                min-width:155px;
            }
            .email-box .email-content{
                padding:25px 10px 20px;
            }
            .email-box .email-content h2{
                font-size:24px;
            }
            .email-box .email-content p{
                font-size:14px;
            }
            .email-box .email-content a{
                width: 250px;
                margin-top: 35px;
                height: 50px;
                font-size: 20px;
                line-height: 50px;
            }
        }
    </style>
</head>
<body>
<div class="email-box">
    <div class="email-banner">
        <img src="data:image/jpeg;base64," alt="">
    </div>
    <div class="email-content">
        <h2>Dear PatPat Customer,</h2>
        <p>Weve noticed that you still have a few items in your cart. Due to popularity, some items might not be available soon. Check them out before theyre gone~</p>
        <a href="/cart">VIEW CART</a>
    </div>
</div>
</body>
</html>